import { useEffect } from "react"

export default function AllCateg() {
    const [data, setData] = useState([])
    useEffect(()=>{
        fetch('http://localhost:8081/allcateg')
        .then(res => res.json())
        .then(data => setData(data))
        .catch(err => console.log(err));

    }, [])

    return(
        <div>
            <thead>
                <th>Title</th>
                <th>Category</th>
                <th>Year Published</th>
            </thead>

            <tbody>
                {data.map((d, i) => (
                <tr key={i}>
                    <td>{d.title}</td>
                    <td>{d.category}</td>
                    <td>{d.year}</td>
                </tr>

                ))}
            </tbody>
        </div>
    )
}
